Table.ScriptNotes:
Script is expecting that the following variables are declared in any parent script calling this function:

@Ticket#@ - script parameter
@ScriptID@ - Manually set at top of parent script
@ScriptResult@ - Set at every exit path.    1 for success -1 for failure.
@ResultMessage@ - Set at every exit path, indicating the reason for failure / success.

This function script is intended to send the email to the LTRunByUser's e-mail address, and will also post a comment to the ConnectWise ticket # provided.

The following variables are expected to be declared in the parent script:

@UserEmail@ - Defined once at top of parent script.
@Ticket#@ - Script Parameter on parent script
@LtTicketID@ - Defined once at top of script, e.g.) 4
@AdminUser@ - Usually defined as 1
@EmailSubject@ - Subject to be used for E-mail
@MessageContent@
